export const TopNav = () => {
    return (
      <Row className='components_topnav'>
        <Col xs={11}>d</Col>
        <Col xs={1}>
          <FontAwesomeIcon icon={faCommentDots} style={{color:"width"}}/> Hablemos
        </Col>
      </Row>
    )
}

